dot((0,0));
dot((1,0));
dot((-1,0));
dot((.5,sqrt(3)/2));
dot((.5,-sqrt(3)/2));
dot((-.5,sqrt(3)/2));
dot((-.5,-sqrt(3)/2));
[/asy]

In trapezoid $ABCD$ with bases $\overline{AB}$ and   $\overline{CD}$, we have $AB = 52$, $BC = 12$, $CD = 39$, and $DA = 5$. What is the area of $ABCD$?

[asy]
pair A,B,C,D;
A=(0,0);
B=(4,0);
C=(3.3,1);
D=(0.3,1);
label("$A$",A,S);
label("$B$",B,S);
label("$C$",C,N);
label("$D$",D,N);
label("52",(2,0),S);
label("39",(1.8,1),N);
label("5",(0.15,0.5),W);
label("12",(3.65,0.5),E);
draw(A--B--C--D--cycle);
[/asy]

In rectangle $ABCD$, points $F$ and $G$ lie on $\overline{AB}$ so that $AF = FG = GB$ and $E$ is the midpoint of $\overline{DC}$. Also, $\overline{AC}$ intersects $\overline{EF}$ at $H$ and $\overline{EG}$ at $J$. The area of rectangle $ABCD$ is 70. Find the area of triangle $EHJ$.

[asy]
pair A,B,C,D,I,F,G,H,J;
A=(0,0);
B=(9,0);
C=(9,5);
D=(0,5);
F=(3,0);
G=(6,0);
I=(4.5,5);
H=(3.5,1.67);
J=(5,3.33);
draw(A--B--C--D--cycle);
draw(A--C);
draw(F--I--G);
label("$A$",A,W);
label("$B$",B,E);
label("$C$",C,E);
label("$D$",D,W);
label("$E$",I,N);
label("$F$",F,S);
label("$G$",G,S);
label("$H$",H,NW);
label("$J$",J,NE);
[/asy]

Let $a,$ $b,$ $c,$ $d,$ and $e$ be the distinct roots of the equation $x^5 + 7x^4 - 2 = 0.$  Find
\begin{align*}
&\frac{a^3}{(a - b)(a - c)(a - d)(a - e)} + \frac{b^3}{(b - a)(b - c)(b - d)(b - e)} \\
&\quad + \frac{c^3}{(c - a)(c - b)(c - d)(c - e)} + \frac{d^3}{(d - a)(d - b)(d - c)(d - e)} \\
&\quad + \frac{e^3}{(e - a)(e - b)(e - c)(e - d)}.
\end{align*}

Below is a portion of the graph of a function, $y=h(x)$:

[asy]
import graph; size(8cm); real lsf=0.5; pen dps=linewidth(0.7)+fontsize(10); defaultpen(dps); pen ds=black; real xmin=-0.75,xmax=8.25,ymin=-1.25,ymax=10.25;

pen cqcqcq=rgb(0.75,0.75,0.75);

/*grid*/ pen gs=linewidth(0.7)+cqcqcq+linetype("2 2"); real gx=1,gy=1;
for(real i=ceil(xmin/gx)*gx;i<=floor(xmax/gx)*gx;i+=gx) draw((i,ymin)--(i,ymax),gs); for(real i=ceil(ymin/gy)*gy;i<=floor(ymax/gy)*gy;i+=gy) draw((xmin,i)--(xmax,i),gs);

Label laxis; laxis.p=fontsize(10);

xaxis("",xmin,xmax,Ticks(laxis,Step=1.0,Size=2,NoZero),Arrows(6),above=true); yaxis("",ymin,ymax,Ticks(laxis,Step=1.0,Size=2,NoZero),Arrows(6),above=true);
real f1(real x){return (x-0.5)*(x-2.5)*(x-6.5)*(x-7.5)/16+x;}
draw(graph(f1,-0.25,8.25),linewidth(1));
clip((xmin,ymin)--(xmin,ymax)--(xmax,ymax)--(xmax,ymin)--cycle);
label("$y=h(x)$",(8.5,8),E);
[/asy]

What is the sum of all integers $x$ in the interval shown ($0\le x\le 8$) such that $h(x)>x$ ?

A "slackrope walker" is much like a tightrope walker except that the rope on which he performs is not pulled tight. Paul, a slackrope walker, has a rope tied to two $15\text{ m}$ high poles which are $14\text{ m}$ apart. When he is standing on the rope $5\text{ m}$ away from one of the poles, he is $3\text{ m}$ above the ground. How long in meters is the rope?

[asy]
draw((0,0)--(14,0)--(14,15)--(5,3)--(0,15)--cycle,black+linewidth(1));
draw((0,3)--(5,3)--(5,0),black+linewidth(1)+dashed);
draw((0,-3)--(6,-3),black+linewidth(1));
draw((8,-3)--(14,-3),black+linewidth(1));
draw((0,-3.5)--(0,-2.5),black+linewidth(1));
draw((14,-3.5)--(14,-2.5),black+linewidth(1));
draw((0,0)--(1,0)--(1,1)--(0,1)--cycle,black+linewidth(1));
draw((14,0)--(14,1)--(13,1)--(13,0)--cycle,black+linewidth(1));
draw(rotate(90)*Label("Paul"),(5,3),3N);
label("5",(0,3)--(5,3),N);
label("3",(5,0)--(5,3),E);
label("14",(7,-3));
label("15",(14,0)--(14,15),E);
[/asy]

Let $a,$ $b,$ $c,$ $d,$ and $e$ be the distinct roots of the equation $x^5 + 7x^4 - 2 = 0.$  Find
\begin{align*}
&\frac{a^4}{(a - b)(a - c)(a - d)(a - e)} + \frac{b^4}{(b - a)(b - c)(b - d)(b - e)} \\
&\quad + \frac{c^4}{(c - a)(c - b)(c - d)(c - e)} + \frac{d^4}{(d - a)(d - b)(d - c)(d - e)} \\
&\quad + \frac{e^4}{(e - a)(e - b)(e - c)(e - d)}.
\end{align*}

In quadrilateral $ABCD$, angle $BAD$ and angle $CDA$ are trisected as shown. What is the degree measure of angle $AFD$?

[asy]
size(150);
pair A , B, C, D; A = (0,0); B = (2, 4); C = (7,4); D = (7, -2);
draw( (0,0)--(2,4) -- (7,4) -- (7, -2)-- cycle);
label("$A$", A, SW);
label("$B$", B, NW);
label("$C$", C, NE);
label("$D$", D, SE);
pair E, F;
E = (4.5-.2,1-.2); F = (5, 3);
draw(A--E--D); draw(A--F--D);
label("$E$", E, N); label("$F$", F, NW);
dot(A);dot(B);dot(C);dot(D);dot(E);dot(F);
label("$x$", (1, 1.5), S); label("$x$", (2, 1), S+W); label("$x$", (2, -1), N+N+N+W);
label("$y$", (5.5+.3, .5-.3), S); label("$y$", (6.5+.3, 0)); label("$y$", (5+.5, -1.5+.3));
label("$110^{\circ}$",(2.5,3.5)); label("$100^{\circ}$",(6.5-.2,3.5));
[/asy]

