The parametric curve $(x,y) = (\sin t, \sin 2t)$ is plotted below.

[asy]
unitsize(2 cm);

pair moo (real t) {
  return (sin(t),sin(2*t));
}

real t;
path foo = moo(0);

for (t = 0; t <= 2*pi + 0.1; t = t + 0.1) {
  foo = foo--moo(t);
}

draw((-1.2,0)--(1.2,0));
draw((0,-1.2)--(0,1.2));
draw(foo,red);
[/asy]

This curve can also be expressed in the form
\[ax^4 - bx^2 + cy^2 = 0,\]where $a,$ $b,$ and $c$ are positive integers.  Find the smallest possible value of $a + b + c.$

Five points $A$, $B$, $C$, $D$, and $O$ lie on a flat field.  $A$ is directly north of $O$, $B$ is directly west of $O$, $C$ is directly south of $O$, and $D$ is directly east of $O$. The  distance between $C$ and $D$ is 140 m.  A hot-air balloon is positioned in the air at $H$ directly above $O$. The balloon is held in place by four ropes $HA$, $HB$, $HC$, and $HD$.  Rope $HC$ has length 150 m and rope $HD$ has length 130 m. [asy]
size(250);
pair A, B, C, D, O, H, W, X, Y, Z;
O=(0,0);
A=(1,1);
D=(1.5,-.3);
B=(-1.5,.3);
C=(-1,-1);
H=(0,2.5);
W=(5/3)*(A+D);
X=(5/3)*(A+B);
Y=(-1)*(W);
Z=(-1)*(X);
draw(W--X--Y--Z--W);
draw(A--C);
draw(B--D);
draw(O--H, linewidth(1));
draw(A--H, dashed);
draw(B--H, dashed);
draw(C--H, dashed);
draw(D--H, dashed);
dot(A);
dot(B);
dot(C);
dot(D);
dot(O);
dot(H);
label("A", A, NE);
label("B", B, SW);
label("C", C, SE);
label("D", D, NE);
label("O", O, SE);
label("H", H, NW);
[/asy]

To reduce the total length of rope used, rope $HC$ and rope $HD$ are to be replaced by a single rope $HP$ where $P$ is a point on the straight line between $C$ and $D$. (The balloon remains at the same position $H$ above $O$ as described above.)  Determine the greatest length of rope that can be saved.

Using data from 1944 through 2000, the histogram shows the number of years that had a particular number of hurricanes reaching the East Coast of the U.S. For example, in 14 of those years there was exactly one hurricane each year that reached the East Coast of the U.S. What is the median number of hurricanes per year reaching the East Coast from 1944 through 2000?

[asy]
size(150);
real textsize = 10*pt;
real w = 1;
draw((0,17)--(0,0)--(18,0),linewidth(w));
for(int i = 1; i <= 17; ++i)

if(i != 5 && i != 10 && i != 15)

draw(shift(i*up)*((0,0)--(18,0)));

else

draw(shift(i*up)*((0,0)--(18,0)),linewidth(w));
for(int i = 0; i < 17; ++i)

draw(shift(i*up)*((-.3,1)--(.3,1)),linewidth(w));
label(rotate(90)*"\textbf{Number of Years}",(-3.5,17/2),fontsize(textsize));
for(int i = 1; i<4; ++i)

label("\textbf{"+string(5i)+"}",(0,5i),left,fontsize(textsize));
for(int i = 0; i<4; ++i)

label("\textbf{"+string(2i)+"}",(4i+2,0),S,fontsize(textsize));
label("\textbf{Number of Hurricanes}",(9,-3),fontsize(textsize));

void bar(int barnumber,int height)
{filldraw((2barnumber -1 ,0)--(2barnumber-1,height)--(2barnumber + 1,height)--(2barnumber + 1,0)--cycle,gray(.6),black+linewidth(w));
}
bar(1,5); bar(2,14); bar(3,17); bar(4,12); bar(5,2); bar(6,4); bar(7,2); bar(8,1);
[/asy]

